import React from 'react';
import logo from './logo.svg';
import './App.css';
import 'bootstrap/dist/css/bootstrap.min.css';


function UserProfile() {
  return (
    <div id="userNameBody">
      <img className="mainLogo" src="logo.png" />
    </div>
  );
}
function HistoryBar() {
  return (
    <div>
      Hello
    </div>
  );
}

function BackButton() {
  return (
    <div>
      Hello
    </div>
  );
}

function ProfileSideBar() {
  return (
    <div className="sideBar">
      <UserProfile />
    </div>
  );
}

function App() {

  return (
    <Container className="App">
      <Row>
        <Col lg={4}> <ProfileSideBar /> </Col>
        <Col lg={8}> Hi </Col>
      </Row>
      <Row>
        Hello
      </Row>
    </Container>
  );
}

export default App;
